<html><head><meta http-equiv="Content-Type" content="text/html; charset=UTF-8"></head><body><b>확인되지 않은 IP</b><p>확인되지 않은 IP 보고서에는 지역이나 도메인 호스트 같은 소유권 데이터가 없는 IP로 방문한 모든 방문자가 나열됩니다. 확인되지 않은 IP 보고서에 있는 IP들은 관련 Urchin 지역 보고서나 도메인 보고서에서 추적할 수 없습니다.<p><p><%dic|default|505%><p> 두 기간을 비교하려면 파란색 기간 제목 표시줄에 있는 <img alt="Date Range Comparison" title="Date Range Comparison" src="/uicons/report/ccals.gif" border="0"> 아이콘을 클릭하십시오.</body></html>
